import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Databutton from "./Databutton.js";
import Login from "./Login";

function App() {
    return (
        <div className="App">
            <Login/>
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
                <Databutton />
            </header>
        </div>
    );
}

export default App;
